import React, {useState} from "react";
import {useHistory, withRouter} from "react-router-dom";
import {AppBar, Tabs, Tab} from "@material-ui/core";

const MainTab = (props) => {
    console.log((props.tabValue))
    const [value, setValue] = useState(Number(props.tabValue))
    const history = useHistory();
    const HandleChange = (event, newValue) => {
        setValue(newValue)
        history.replace(newValue === 0 ? "/main/art" : newValue === 1 ? "/main/my" : newValue === 2 ? "/main/create" : newValue === 3 ? "/main/support" : "/main/art");
    };

    return (
        <div style={{ backgroundColor:'#BBDEFB', height:"100%"}}>
            <AppBar style={{backgroundColor:'#BBDEFB'}}>
                <Tabs value={value} onChange={HandleChange} style={{position:'fixed',width:'100%', backgroundColor:'#BBDEFB', float:'right'}}>
                    <Tab label="Art" style={{right:'0'}}/>
                    <Tab label="My" style={{right:'0'}}/>
                    <Tab label="Create" style={{right:'0'}}/>
                    <Tab label="Support" style={{right:'0'}}/>
                </Tabs>

                <p>aaaaaa</p>
            </AppBar>
        </div>
    );
}

export default withRouter(MainTab);
